          "QUESTION":"What is the name of capital of Azerbaijan",
          "ANSWERS":[
            "Baku",
            "Gandja",
            "Samaxi"
          ],
          "RIGHTANSWER":"1"
        },
        {
          "QUESTION":"What is the name of capital of Turkiye",
          "ANSWERS":[
            "Ankara",
            "Istanbul",
            "Baku"
          ],
          "RIGHTANSWER":"1"
        }
      ]
    }
    ]);
  const loggedIn = useSelector((state) => state.login);

  useEffect(() => {
    fetchData();
  }, []);

